import React from "react";
import { Box, Link, Typography } from "@mui/material";
import { Link as RouterLink } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";
import { Carousel } from "react-responsive-carousel";

const HomePage = () => {
  const images = [
    {
      original:
        "http://vsegda-pomnim.com/uploads/posts/2022-03/1647445617_11-vsegda-pomnim-com-p-ozero-borovoe-foto-11.jpg",
      thumbnail:
        "http://vsegda-pomnim.com/uploads/posts/2022-03/1647445617_11-vsegda-pomnim-com-p-ozero-borovoe-foto-11.jpg",
      description: "Legend 1"
    },
    {
      original:
        "https://tengrinews.kz/userdata/news/2020/news_420969/resize/photo_343068.jpeg",
      thumbnail:
        "https://tengrinews.kz/userdata/news/2020/news_420969/resize/photo_343068.jpeg",
      description: "Legend 2"
    },
    {
      original:
        "https://34travel.me/media/upload/images/2019/july/kazakhstan/18.jpg",
      thumbnail:
        "https://34travel.me/media/upload/images/2019/july/kazakhstan/18.jpg",
      description: "Legend 3"
    }
  ];
  return (
    <Router>
      <Box
      sx={{
      backgroundColor: "white",
      height: "100vh",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      flexDirection: "column",
    }}
      >
        <Typography variant="h2" color="common.white" gutterBottom>
          Добро пожаловать в Казахстан
        </Typography>
        <Box
  sx={{
    position: "fixed",
    top: 0,
    width: "100%",
    display: "flex",
    flexDirection: "row",
    justifyContent: "flex-start",
    alignItems: "center",
    backgroundColor: "rgba(12, 105, 24, 1);",
    padding: "10px",
    zIndex: 1,
  }}
>
  <Link
    component={RouterLink}
    to="/"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Главное
  </Link>
  <Link
    component={RouterLink}
    to="/top-places"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Топ мест
  </Link>
  <Link
    component={RouterLink}
    to="/useful-info"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Полезное
  </Link>
  <Link
    component={RouterLink}
    to="/about"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    О нас
  </Link>
</Box>

      </Box>
    </Router>
  );
};

export default HomePage;
